  String? get cod => _cod;
  num? get message => _message;
  num? get cnt => _cnt;
  List<WeatherList>? get weatherlist => _weatherlist;
  City? get city => _city;

  ForecastWeather({
      String? cod, 
      num? message, 
      num? cnt, 
      List<WeatherList>? weatherlist,
      City? city}){
    _cod = cod;
    _message = message;
    _cnt = cnt;
    _weatherlist = weatherlist;
    _city = city;
}

  ForecastWeather.fromJson(dynamic json) {
    _cod = json["cod"];
    _message = json["message"];
    _cnt = json["cnt"];
    if (json["list"] != null) {
      _weatherlist = [];
      json["list"].forEach((v) {
        _weatherlist?.add(WeatherList.fromJson(v));
      });
    }
    _city = json["city"] != null ? City.fromJson(json["city"]) : null;
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["cod"] = _cod;
    map["message"] = _message;
    map["cnt"] = _cnt;
    if (_weatherlist != null) {
      map["list"] = _weatherlist?.map((v) => v.toJson()).toList();
    }
    if (_city != null) {
      map["city"] = _city?.toJson();
    }
    return map;
  }

}

