class WeatherList {
  num? _dt;
  Main? _main;
  List<Weather>? _weather;
  Clouds? _clouds;
  Wind? _wind;
  num? _visibility;
  num? _pop;
  Sys? _sys;
  String? _dtTxt;

  num? get dt => _dt;
  Main? get main => _main;
  List<Weather>? get weather => _weather;
  Clouds? get clouds => _clouds;
  Wind? get wind => _wind;
  num? get visibility => _visibility;
  num? get pop => _pop;
  Sys? get sys => _sys;
  String? get dtTxt => _dtTxt;

  WeatherList({
      num? dt, 
      Main? main, 
      List<Weather>? weather, 
      Clouds? clouds, 
      Wind? wind, 
      num? visibility, 
      num? pop, 
      Sys? sys, 
      String? dtTxt}){
    _dt = dt;
    _main = main;
    _weather = weather;
    _clouds = clouds;
    _wind = wind;
    _visibility = visibility;
    _pop = pop;
    _sys = sys;
    _dtTxt = dtTxt;
}

  WeatherList.fromJson(dynamic json) {
    _dt = json["dt"];
    _main = json["main"] != null ? Main.fromJson(json["main"]) : null;
    if (json["weather"] != null) {
      _weather = [];
      json["weather"].forEach((v) {
        _weather?.add(Weather.fromJson(v));
      });
    }
    _clouds = json["clouds"] != null ? Clouds.fromJson(json["clouds"]) : null;
    _wind = json["wind"] != null ? Wind.fromJson(json["wind"]) : null;
    _visibility = json["visibility"];
    _pop = json["pop"];
    _sys = json["sys"] != null ? Sys.fromJson(json["sys"]) : null;
    _dtTxt = json["dt_txt"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["dt"] = _dt;
    if (_main != null) {
      map["main"] = _main?.toJson();
    }
    if (_weather != null) {
      map["weather"] = _weather?.map((v) => v.toJson()).toList();
    }
    if (_clouds != null) {
      map["clouds"] = _clouds?.toJson();
    }
    if (_wind != null) {
      map["wind"] = _wind?.toJson();
    }
    map["visibility"] = _visibility;
    map["pop"] = _pop;
    if (_sys != null) {
      map["sys"] = _sys?.toJson();
    }
    map["dt_txt"] = _dtTxt;
    return map;
  }

}

